\relative f'' <<
  \new Voice {
    \clef treble
    \time 4/4
    \key d \major

    \partial 4 a4 |
    \repeat volta 2 {
      fis16 d8. a fis'16 d8. a16 fis a8. |
      b8. g16 e8. d16 cis e8. a, cis16 |
      d8. fis16 a8. fis16 b8. a16 g8. fis16 |
      g16 b,8. fis'16 d8. e a16 b8. cis16 |
      \break

      d8. a16 fis'8. e16 d8. a16 fis a8. |
      b8. g16 e8. d16 cis e8. a,8. cis16 |
      d8. fis16 a8. fis16 b8. g16 d' b8. |
    } \alternative { {
      a8. d16 cis e8. d4 a'8. g16
    } {
      a,8. d16 cis e8. d4
    } } \break

    \repeat volta 2 {
      fis8. g16 |
      a16 a,8. d a'16 g4 fis8. e16 |
      fis8. e16 d b8. a4 fis16 a8. |
      b8. b,16 g' b8. a a,16 d a'8. |
      \tuplet 3/2 { g8 fis e } \tuplet 3/2 { fis8 e d } cis16 e8. a cis16 |
      \break

      d8. a16 fis'8. e16 d8. a16 fis16 a8. |
      b8. g16 e8. d16 cis e8. a,8. cis16 |
      d8. fis16 a8. fis16 b8. g16 d' b8. |
      a8. d16 cis e8. d4
    }
  }

  \new ChordNames {
    \chordmode {
      s4 |
      d2 d/fis | g a | d g | e4:m e:7/gis a2 |
      d2 d/fis | g a | d4 d/fis g e:7/gis | a2 d | a2 d4

      a4:7 |
      d2 a:7 | d4 g d2/fis | g2 d/fis | e4:m e:7/gis a2 |
      d2 d/fis | g4 e:m a a:7/cis | d4 d/fis g f:dim | d4/a a:7 d
    }
  }
>>
